import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import { Link } from 'react-router-dom';
import { makeStyles } from '@material-ui/core';
import clsx from 'clsx'
import { useState } from 'react/cjs/react.development';

const useStyles=makeStyles((theme)=>({
    btn:{
        textDecoration:'none',
        color:'white'
    }
}))
export default function Navbar() {
    const classes=useState();
    return (
        <>
            <Box sx={{ flexGrow: 1 }}>
                <AppBar position="static" color="primary">
                    <Toolbar>
                        <Typography
                            variant="h6"
                            component="div"
                            sx={{ flexGrow: 1 }}
                        >
                            News
                        </Typography>
                        <Link to="/Business"  className={classes.btn}>
                            <Button color="inherit">business</Button>
                        </Link>
                        <Link to="/Entertainment" className="text-decoration-none text-white bg-dark mx-3">
                            <Button color="inherit">entertainment</Button>
                        </Link>
                        <Link to="/General" className="text-decoration-none text-white bg-secondary">
                            <Button color="inherit">general</Button>
                        </Link>
                        <Link to="/Health" className="text-decoration-none text-white bg-dark mx-3">
                            <Button color="inherit">health</Button>
                        </Link>
                        <Link to="/Science" className="text-decoration-none text-white bg-success">
                            <Button color="inherit">science</Button>
                        </Link>
                        <Link to="/Sports" className="text-decoration-none text-white bg-dark mx-3">
                            <Button color="inherit">sports</Button>
                        </Link>
                        <Link to="/Technology" className="text-decoration-none text-white bg-danger">
                            <Button color="inherit">technology</Button>
                        </Link>
                    </Toolbar>
                </AppBar>
            </Box>
        </>
    );
}
